import React from 'react'
import SignUpSeller from '../page/signUpSeller'

class ModalSeller extends React.Component{
    render(){
        return(
            // <!-- Modal -->
            <div class="modal fade" id="exampleModalSeller" tabindex="-1" role="dialog" aria-labelledby="exampleModalSellerTitle" aria-hidden="true">
            <div class="modal-dialog modal-dialog-centered" role="document">
                <div class="modal-content">
                <div class="modal-header">
                    <h5 class="modal-title align-content-center" id="exampleModalLongTitle">Please Login to Continue</h5>
                    <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                    <span aria-hidden="true">&times;</span>
                    </button>
                </div>
                <div class="modal-body">
                    <SignUpSeller/>
                </div>
                </div>
            </div>
            </div>
                    )
                }
}
export default ModalSeller;
